            if (result.value) {
                $.ajax({
                    url: '/Admin/NCC/BackNCC',
                    type: 'post',
                    dataType: 'json',
                    data: {
                        ncc_id: ncc_id
                    },
                    success: function (data) {
                        if (data == ""ok"") {
                            alert(""Đã HIỆN thành công"");
                            location.reload();
                        }
                        else {
                            alert(""HIỆN không thành công"");
